ransparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5.1 SITE_NAME may, at its sole discretion, enable Members to (i) create, upload, post, send, receive and store content, such as text, photos, audio, video, or other materials and information on or through the SITE_NAME Platform ("Member Content"); and (ii) access and view Member Content and any content that SITE_NAME itself makes available on or through the SITE_NAME Platform, including proprietary SITE_NAME content and any content licensed or authorized for use by or through SITE_NAME from a third party ("SITE_NAME Content" and together with Member Content, "Collective Content").</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5.2 Subject to your compliance with these Terms, SITE_NAME grants you a limited, non-exclusive, non-sublicensable, revocable, non-transferable license to (i) download and use the Application on your personal device(s); and (ii) access and view any Collective Content made available on or through the SITE_NAME Platform and accessible to you, solely for your personal and non-commercial use.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">6. Service Fees</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">6.1 SITE_NAME may charge fees to Hosts ("Host Fees") and/or Guests ("Guest Fees") (collectively, "Service Fees") in consideration for the use of the SITE_NAME Platform. More information about when Service Fees apply and how they are calculated can be found on our Service Fees page.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">6.2 Any applicable Service Fees (including any applicable Taxes) will be displayed to a Host or Guest prior to publishing or booking a Listing. SITE_NAME reserves the right to change the Service Fees at any time, and will provide Members adequate notice of any fee changes before they become effective.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">6.3 You are responsible for paying any Service Fees that you owe to SITE_NAME. The applicable Service Fees (including any applicable Taxes) are collected by SITE_NAME Payments. SITE_NAME Payments will deduct any Host Fees from the Listing Fee before remitting the payout to the Host. Any Guest Fees are included in the Total Fees collected by SITE_NAME Payments. Except as otherwise provided on the SITE_NAME Platform, Service Fees are non-refundable.</span></p><h5 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.2 Booking Accommodations</span></h5><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.2.1 You understand that a confirmed booking of an Accommodation (“Accommodation Booking”) is a limited license granted to you by the Host to enter, occupy and use the Accommodation for the duration of your stay, during which time the Host (only where and to the extent permitted by applicable law) retains the right to re-enter the Accommodation, in accordance with your agreement with the Host.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.2.2 You agree to leave the Accommodation no later than the checkout time that the Host specifies in the Listing or such other time as mutually agreed upon between you and the Host. If you stay past the agreed upon checkout time without the Host\'s consent (“Overstay”), you no longer have a license to stay in the Accommodation and the Host is entitled to make you leave in a manner consistent with applicable law. In addition, you agree to pay, if requested by the Host, for each twenty-four (24) hour period (or any portion thereof) that you Overstay, an additional nightly fee of up to two (2) times the average nightly Listing Fee originally paid by you to cover the inconvenience suffered by the Host, plus all applicable Guest Fees, Taxes, and any legal expenses incurred by the Host to make you leave (collectively, "Overstay Fees"). Overstay Fees for late checkouts on the checkout date that do not impact upcoming bookings may be limited to the additional costs incurred by the Host as a result of such Overstay. If you Overstay at an Accommodation, you authorize SITE_NAME (via SITE_NAME Payments) to charge you to collect Overstay Fees. A Security Deposit, if required by a Host, may be applied to any Overstay Fees due for a Guest’s Overstay.</span></p><h5 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.3 Booking Experiences, Events and other Host Services</span></h5><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.3.1 You should carefully review the description of any Experience, Event or other Host Service you intend to book to ensure you (and any additional guests you are booking for) meet any minimum age, proficiency, fitness or other requirements which the Host has specified in their Listing. At your sole discretion you may want to inform the Host of any medical or physical conditions, or other circumstances that may impact your and any additional guest’s ability to participate in any Experience, Event or other Host Service. In addition, certain laws, like the minimum legal drinking age in the location of the Experience, Event or other Host Service, may also apply. You are responsible for identifying, understanding, and complying with all laws, rules and regulations that apply to your participation in an Experience, Event or other Host Service.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.3.2 Before and during an Experience, Event or other Host Service you must at all times adhere to the Hosts’ instructions.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.3.3 You may not bring any additional individuals to an Experience, Event or other Host Service unless such an individual was added by you as an additional guest during the booking process on the SITE_NAME Platform.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">8.4 SITE_NAME Travel Credits</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME Travel Credits may be redeemed for eligible bookings via the SITE_NAME Platform as specified in the terms and conditions provided with the Travel Credit. You may only redeem SITE_NAME Travel Credits after the SITE_NAME Travel Credits are reflected in your SITE_NAME Account.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9. Booking Modifications, Cancellations and Refunds, Resolution Center</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.1 Hosts and Guests are responsible for any modifications to a booking that they make via the SITE_NAME Platform or direct SITE_NAME customer service to make ("Booking Modifications"), and agree to pay any additional Listing Fees, Host Fees or Guest Fees and/or Taxes associated with such Booking Modifications.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.2 Guests can cancel a confirmed booking at any time pursuant to the Listing’s cancellation policy, and SITE_NAME Payments will refund the amount of the Total Fees due to the Guest in accordance with such cancellation policy. Unless extenuating circumstances exist, any portion of the Total Fees due to the Host under the applicable cancellation policy will be remitted to the Host by SITE_NAME Payments pursuant to the Payments Terms.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.3 If a Host cancels a confirmed booking, the Guest will receive a full refund of the Total Fees for such booking within a commercially reasonable time of the cancellation. In some instances, SITE_NAME may allow the Guest to apply the refund to a new booking, in which case SITE_NAME Payments will credit the amount against the Guest’s subsequent booking at the Guest’s direction. Further, SITE_NAME may publish an automated review on the Listing cancelled by the Host indicating that a booking was cancelled. In addition, SITE_NAME may (i) keep the calendar for the Listing unavailable or blocked for the dates of the cancelled booking, and/or (ii) impose a cancellation fee, unless the Host has a valid reason for cancelling the booking pursuant to SITE_NAME’s Extenuating Circumstances Policy or has legitimate concerns about the Guest’s behavior.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.4 For Experiences, Events and other Host Services, if inclement weather creates an unsafe or uncomfortable scenario for Guests, Hosts may modify or cancel a Host Service. If there is a substantial change in the itinerary or the Host Service needs to be cancelled, SITE_NAME will work with the Host and/or Guests to provide Guests an alternative date for the Host Service, an appropriate refund or a rebooking.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.5 In certain circumstances, SITE_NAME may decide, in its sole discretion, that it is necessary to cancel a confirmed booking and make appropriate refund and payout decisions. This may be for reasons set forth in SITE_NAME\'s Extenuating Circumstances Policy or (i) where SITE_NAME believes in good faith, while taking the legitimate interests of both parties into account, this is necessary to avoid significant harm to SITE_NAME, other Members, third parties or property, or (ii) for any of the reasons set out in these Terms.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.6 If a Guest suffers a Travel Issue pursuant to the Guest Refund Policy, SITE_NAME may determine, in its sole discretion, to refund the Guest part or all of the Total Fees in accordance with the Guest Refund Policy.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.7 If, as a Host, your Guest cancels a confirmed booking or SITE_NAME decides that it is necessary to cancel a confirmed booking, and SITE_NAME issues a refund to the Guest in accordance with the Guest Refund Policy, Extenuating Circumstances Policy, or other applicable cancellation policy, you agree that in the event you have already been paid, SITE_NAME Payments will be entitled to recover the amount of any such refund from you, including by subtracting such refund amount out from any future Payouts due to you.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">9.8 Except as otherwise set out in these Terms, Members may use the Resolution Center to send or request money for refunds, additional Host Services, Co-Host Services or Damage Claims related to bookings. You agree to pay all amounts sent through the Resolution Center in connection with your SITE_NAME Account, and SITE_NAME Payments will handle all such payments.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">10. Ratings and Reviews</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">10.1 Within a certain time frame after completing a booking, Guests and Hosts can leave a public review (“Review”) and submit a star rating (“Rating”) about each other. Ratings or Reviews reflect the opinions of individual Members and do not reflect the opinion of SITE_NAME. Ratings and Reviews are not verified by SITE_NAME for accuracy and may be incorrect or misleading.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">10.2 Members are prohibited from manipulating the Ratings and Reviews system in any manner, such as instructing a third party to write a positive or negative Review about another Member.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">10.3Ratings and Reviews are part of a Member’s public profile and may also be surfaced elsewhere on the SITE_NAME Platform (such as the Listing page) together with other relevant information such as number of bookings, number of cancellations, average response time and other information.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">11. Damage to Accommodations, Disputes between Members</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Times New Roman\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">As a Guest, you are responsible for leaving the Accommodation (including any personal or other property located at the Accommodation) in the condition it was in when you arrived. You are responsible for your own acts and omissions and are also responsible for the acts and omissions of any individuals whom you invite to, or otherwise provide access to, the Accommodation, excluding the Host (and the individuals the Host invites to the Accommodation, if applicable).</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;">&nbsp;</p><br><br>','status' => 'Active','created_at' => '2016-03-26 14:50:11','updated_at' => '2018-10-27 10:35:45'),
  array('id' => '2','name' => 'Privacy Policy','url' => 'privacy_policy','footer' => 'yes','under' => 'company','content' => '<h1 dir="ltr" style="line-height:1.32;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;" id="docs-internal-guid-b7204f27-7fff-de5d-9531-60321d0a9863"><span style="font-size:33pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"></span><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME Privacy Policy</span></h1><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">This Privacy Policy describes detaily about how SITE_NAME collect, use, process, and disclose your information, in conjunction with your access to and use of the SITE_NAME site and the Payment. This Privacy Policy also applies to the Payment Services provided to you by SITE_NAME Payments pursuant to the Payments Terms of Service. When using the Payment Services, you will be also providing your information, including personal information, to one or more SITE_NAME Payments entities, which will also be the Data Controller of your information related to the Payment Services, generally depending on your Country of Residence.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:13.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">1. INFORMATION WE COLLECT</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">There are three general categories of information we collect.</span></p><h5 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">1.1 Information You Give to Us.</span></h5><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">1.1.1 Information that is necessary for the use of the SITE_NAME Platform</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME collects the user’s personal information when you use the SITE_NAME site.This information is necessary for the adequate performance of the contract between you and site and to allow us to comply with our legal obligations. Without it, we may not be able to provide you with all the requested services.</span></p><ul style="margin-top:0pt;margin-bottom:0pt;"><li dir="ltr" style="list-style-type:disc;font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Account Information -</span><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> When you sign up for an SITE_NAME Account, we require certain information such as your first name, last name, email address, and date of birth.</span></p></li><li dir="ltr" style="list-style-type:disc;font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Profile and Listing Information - </span><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Your additional informations like your address, phone number and profile picture will be asked by SITE_NAME Platform while booking and listing. </span></p></li><li dir="ltr" style="list-style-type:disc;font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;"><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Payment Information -</span><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> In Order to facilitate the processing of payments while booking and listing a property in SITE_NAME platform, financial informations are required that includes your bank account or credit card information.</span></p></li></ul><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:13.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">2. SECURITY</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">We are continuously implementing and updating administrative, technical, and physical security measures to help protect your information against unauthorized access, loss, destruction, or alteration. </span><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#434343;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Some of the safeguards we use to protect your information are firewalls and data encryption, and information access controls.</span><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> If you know or have reason to believe that your SITE_NAME Account credentials have been lost, stolen, misappropriated, or otherwise compromised or in case of any actual or suspected unauthorized use of your SITE_NAME Account, please contact us through sales@trioangle.com.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:13.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">3. CHANGES TO THIS PRIVACY POLICY</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME reserves the right to modify this Privacy Policy at any time in accordance with this provision. The modified and revised Privacy Policy will be updated on the SITE_NAME Platform. The SITE_NAME will also provide you with notice of the modification by email at least thirty days before the date they become effective. If you disagree with the revised Privacy Policy, you may cancel your Account or else it will be effective, your continued access to or use of the SITE_NAME Platform will be subject to the revised Privacy Policy.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:13.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">4. CONTACT US</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">If you have any questions or complaints about this Privacy Policy or SITE_NAME’s information handling practices, you may email us or contact us on </span><a href="mailto:sales@trioangle.com" style="text-decoration:none;"><span style="font-size:10.5pt;font-family:\'Helvetica Neue\';color:#1155cc;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;-webkit-text-decoration-skip:none;text-decoration-skip-ink:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">sales@trioangle.com</span></a><span style="font-size:11pt;font-family:Arial;color:#ff0000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">.</span></p>','status' => 'Active','created_at' => '2016-03-26 16:26:38','updated_at' => '2018-10-27 10:47:54'),
  array('id' => '3','name' => 'Host Guarantee','url' => 'host_guarantee','footer' => 'yes','under' => 'company','content' => '<h1 dir="ltr" style="line-height: 1.32; margin-top: 0pt; margin-bottom: 11pt; background-color: rgb(255, 255, 255); text-align: left;" id="docs-internal-guid-b797d25b-7fff-0862-96c1-2ece1b9432a1"><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"></span><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Host Guarantee </span></h1><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Hosts may benefit from the SITE_NAME Host Guarantee program which is subject to these terms and conditions. The Host Guarantee Terms apply in addition to SITE_NAME’s Terms of Service and the Payments Terms of Service.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The SITE_NAME Host Guarantee</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME agrees to pay you, as a Host, to repair or replace your Property by dispute which is &nbsp;subject to the limitations, exclusions and conditions in the Host Guarantee Terms.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">You must comply with all of the requirements and conditions in these Host Guarantee Terms in order to be eligible to receive any payments for Covered Losses. Your failure to fully comply will prevent your recovery for any Losses. </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">You acknowledge and agree to use your best efforts to communicate with the Responsible Guest (as defined below) as soon as possible after you discover any physical loss or damage to your Property. You must notify SITE_NAME as well as the Responsible Guest about your complaint and attempt to resolve the loss or damage with the Responsible Guest within the earlier of </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(i) fourteen (14) days of the check-out date, or </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(ii) before your next guest checks in. You may fulfill this obligation by submitting a claim via the Resolution Center.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">You acknowledge and agree that any amount of Losses payable to you under the SITE_NAME Host Guarantee will be reduced by the amounts you have already collected for the same Covered Losses from a source other than the SITE_NAME Host Guarantee, including without limitation: (i) amounts received under an insurance policy, guarantee or indemnity; (ii) a security deposit; or (iii) payment directly by the Responsible Guest or an Invitee (defined below), or other party or an insurer or guarantor of such party.</span></p><h4 dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Contacting SITE_NAME</span></h4><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">If you have any questions about these SITE_NAME Host Guarantee Terms, please email us at </span><a href="mailto:sales@trioangle.com" style="text-decoration:none;"><span style="font-size:12pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;-webkit-text-decoration-skip:none;text-decoration-skip-ink:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">sales@trioangle.com</span></a></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;background-color:#ffffff;">&nbsp;</p><br><br>','status' => 'Active','created_at' => '2016-03-26 17:33:02','updated_at' => '2018-10-27 10:46:55'),
  array('id' => '4','name' => 'Guest Refund','url' => 'guest_refund','footer' => 'yes','under' => 'company','content' => '<h1 dir="ltr" style="line-height:1.32;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;" id="docs-internal-guid-73737ad3-7fff-e6a0-655f-88f4f447ee7e"><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"></span><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#484848;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME Guest Refund Policy</span></h1><br><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">These terms and conditions govern SITE_NAME’s policy for Guest refunds and the obligations of the Host associated with the Guest Refund Policy, that applies in addition to SITE_NAME’s Terms of Service. The Guest Refund Policy is available to Guests who book and pay for an Accommodation through the SITE_NAME Platform and suffer a Travel Issue. The Guest’s rights under this Guest Refund Policy will supersede the Host’s cancellation policy.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">All capitalized terms shall have the meaning set forth in the SITE_NAME Terms or Payments Terms unless otherwise defined in this Guest Refund Policy. By using the SITE_NAME Platform as a Host or Guest, you are indicating that you have read and that you understand and agree to be bound by this Guest Refund Policy.</span></p><p dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">1. Travel Issue</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;margin-left: 13.5pt;text-align: justify;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Only a Guest may submit a claim for a Travel Issue. &nbsp;If you are a Guest, in order to submit a valid claim for a Travel Issue and receive the benefits with respect to your reservation, you are required to meet each of the following conditions:</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;margin-left: 13.5pt;text-align: justify;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"><br class="kix-line-break"></span><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(i) You must bring the Travel Issue to our attention through mail by </span><a href="mailto:sales@trioangle.com" style="text-decoration:none;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#1155cc;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;-webkit-text-decoration-skip:none;text-decoration-skip-ink:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">sales@trioangle.com</span></a><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> with information (including photographs or other evidence) about the accommodation and the circumstances of the Travel Issue within 24 hours after the start of your reservation, and must respond to any requests by us for additional information or cooperation on the Travel Issue.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;margin-left: 13.5pt;text-align: justify;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"><br class="kix-line-break"></span><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(ii) You must not have directly or indirectly caused the Travel Issue (through your action, omission or negligence).</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;margin-left: 13.5pt;text-align: justify;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"><br class="kix-line-break"></span><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(iii) You must have used reasonable efforts to try to remedy the circumstances of the Travel Issue with the Host prior to making a claim for a Travel Issue.</span></p><p dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">2. The Guest Refund Policy</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">If you are a Guest and suffer a Travel Issue, we agree, at our discretion, to either reimburse you up to the amount paid by you through the SITE_NAME Platform depending on the nature of the Travel Issue suffered, or use our reasonable efforts to find and book you another Accommodation for any unused nights left in your booking which is reasonably comparable to the Accommodation described in your original booking in terms of size, rooms, features and quality. </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">All determinations of SITE_NAME with respect to the Guest Refund Policy, including without limitation the size of any refund and the comparability of alternate Accommodations, shall be in SITE_NAME’s discretion, and final and binding on the Guests and Hosts.</span></p><p dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">3. Conditions to Claim a Travel Issue</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">To submit a valid claim for a Travel Issue and receive the benefits with respect to your booking, you are required to meet each of the following conditions:</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(a) you must be the Guest that booked the Accommodation;</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(b) you must bring the Travel Issue to our attention by providing us with information about the Accommodation and the circumstances of the Travel Issue within 24 hours after the start of your booking or you discover the existence of the Travel Issue.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(c) you must not have directly or indirectly caused the Travel Issue </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">(d) unless SITE_NAME advises you that the Travel Issue cannot be remediated, you must have used reasonable efforts to try to remedy the circumstances of the Travel Issue with the Host prior to making a claim for a Travel Issue.</span></p><p dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">4. Minimum Quality Standards, Host Responsibilities and Reimbursement to Guest</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">4.1 If you are a Host, you are responsible for ensuring that the Accommodations you list on the SITE_NAME Platform meet minimum quality standards regarding access, adequacy of the Listing description, safety, cleanliness, and do not present a Guest with Travel Issues. During a Guest’s stay at an Accommodation, Hosts should be available, or make a third-party available to resolve any Guest issues.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">4.2 If you are a Host, and if (i) SITE_NAME determines that a Guest has suffered a Travel Issue related to an Accommodation listed by you and (ii) SITE_NAME either reimburses that Guest or provides an alternative Accommodation to the Guest, you agree to reimburse SITE_NAME up to the amount paid by SITE_NAME within 30 days of SITE_NAME’s request. If the Guest is relocated to an alternative Accommodation, you also agree to reimburse SITE_NAME for reasonable additional costs incurred to relocate the Guest. </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">4.3 As a Host, you understand that the rights of Guests under this Guest Refund Policy will supersede your selected cancellation policy. If you dispute the Travel Issue, you may notify SITE_NAME regarding it, you must have used reasonable and good faith efforts to try to remedy the Travel Issue with the Guest prior to disputing the Travel Issue claim.</span></p><p dir="ltr" style="line-height:1.32;margin-top:19pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5. General Provisions</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5.1 No Assignment/No Insurance - This Guest Refund Policy is not intended to constitute an offer to insure, does not constitute insurance or an insurance contract, does not take the place of insurance obtained or obtainable by the Guest. The benefits provided under this Guest Refund Policy are not assignable or transferable by you.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5.2 Modification or Termination - SITE_NAME reserves the right to modify or terminate this Guest Refund Policy, at any time, in its sole discretion, without prior notice. If SITE_NAME modifies this Guest Refund Policy, we will post the modification on the site or provide you with notice of the modification also process all claims for Travel Issues made prior to the effective date of the modifications.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">5.3 Entire Agreement - This Guest Refund Policy constitutes the entire and exclusive and understanding and agreement between SITE_NAME and you regarding and the Guest Refund policy and Supersedes and replaces any and all prior oral or written understandings or agreements between SITE_NAME and you regarding the Guest Refund Policy. Capitalized terms not otherwise defined herein shall have the meaning set forth in the SITE_NAME Terms of service</span><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:11pt;text-align: justify;background-color:#ffffff;"><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">6. Contacting SITE_NAME.</span><span style="font-size:10pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"> If you have any questions about the Guest Refund Policy, please email us at sales@trioangle.com</span></p><br>','status' => 'Active','created_at' => '2016-03-26 17:41:48','updated_at' => '2018-10-27 10:49:19'),
