  array('id' => '8','name' => 'Why Host','url' => 'why_host','footer' => 'yes','under' => 'hosting','content' => '<p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;" id="docs-internal-guid-b5d42c46-7fff-027c-5b97-cab7564fb1b3"><span style="font-size:24pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Earn money as host in SITE_NAME</span></p><br><p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">You can share your unused room, home and apartment as a host and can earn money. SITE_NAME allows host to share the room with guest for rent. </span></p><br><p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;margin-right: 28pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Why host on SITE_NAME?</span></p><br><p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME is online property rental system that shares home or room, regardless to it kind and luxury, that to in a simple way. It makes easy and secure way to earn money and reach millions of travellers who are looking for unique places to stay and just like yours. With rental system, guest makes a comfortable stay in the vacation area, also helps host to earn money.</span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">With SITE_NAME, host - people going to list the house are in full control that is on your booking availability, price quoted for the stay, house rules and also the behaviour and communication with guests. SITE_NAME provides you freedom to handle the process by setting multiple </span></p><p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">check ins.</span></p><br><br><p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">How to be a Host in SITE_NAME?</span></p><br><p dir="ltr" style="line-height:1.3679999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">In SITE_NAME Platform, common people can be host those who wish to share their unused space for stay. You can earn much by following the steps given below</span></p><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">1. Create your listing</span></p><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">It’s free and easy to create a listing on SITE_NAME. Describe your space, how many guests you can accommodate, and add photos and other details. </span></p><br><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">2. Welcome guests</span></p><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Get to know guests before arrival by messaging them on our platform. Most hosts clean the spaces guests can use, and provide essentials like clean sheets, towels, and toilet paper. You can greet guests in person with a key or just send them a door code.</span></p><br><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">3. Get paid</span></p><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">SITE_NAME’s secure payment system means you never have to deal with money directly. Guests are charged before arrival, and you are paid automatically after check in, minus host fee. You can be paid via PayPal &amp; Stripe.</span></p><br><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Is It Safe To Host SITE_NAME?</span></p><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">The online rental system SITE_NAME provides a secure service and safeguard Host and their rental areas with Host Guarantee, Host Protection Insurance.</span></p><br><p dir="ltr" style="line-height:1.3559999999999999;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:11pt;font-family:\'Helvetica Neue\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;">Every SITE_NAME travellers must submit a profile photo and get verified with the phone and email. Guests and hosts each publish reviews after check out keeping everyone accountable and respectful.</span></p><br>','status' => 'Active','created_at' => '2016-03-26 18:41:29','updated_at' => '2018-10-27 10:48:14'),
