  array('id' => '11','name' => 'Hosts Experience Cancellation policy','url' => 'hosts_experience_cancellation_policy','footer' => 'no','under' => '','content' => '<h5 class="underline center">SITE_NAME Hosts Experience &amp; Event Cancellation policy</h5><p><b>General Cancellation</b></p><ul><li>Any experience or event, canceled within 24 hours of booking, is eligible for a full refund.</li><li>Any experience or event cancellation that is 30 days or more before the start date, is eligible for a full refund.</li><li>Cancellations less than 30 days before start date will not be eligible for a refund, unless your spot is booked and completed by another guest.</li><li>Should your spot be booked and completed by another guest, a full refund will be processed within 14 days of the experience start date.</li><li>However, if your reason for cancellation meets our Extenuating Circumstances policy, you will be refunded in full.</li></ul><p><b>Account Verification</b></p><p>Should any member of your party be unable to complete the account verification process within 3 days of purchase, all portions and spots for the experience or event will be canceled and fully refunded.</p>  <p><b>Weather</b></p><p>Hosts make every effort to continue, as scheduled, with experiences or events. Should bad weather conditions create an unsafe scenario for guests or hosts, a change or partial cancellation of an itinerary or activity may be the result. Should an individual experience or event be canceled by host or guest, or should an itinerary substantially change or result in a cessation of the trip, SITE_NAME will work with your host to provide an appropriate refund.</p><p>To officially request a cancellation of your experience or event, please contact us.</p>','status' => 'Active','created_at' => '2016-03-26 18:51:32','updated_at' => '2016-03-26 18:53:14'),
